import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './TraineeList.css';

function TrainerList() {
  const [trainers, setTrainers] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetch('http://localhost:8000/trainers')
      .then(res => res.json())
      .then(data => setTrainers(data));
  }, []);

  return (
    <div className="trainee-container">
      <h2>All Trainers</h2>
      <table className="trainee-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Email</th>
            <th>Profile</th>
          </tr>
        </thead>
        <tbody>
          {trainers.map((t) => (
            <tr key={t.id}>
              <td>{t.id}</td>
              <td>{t.name || '-'}</td>
              <td>{t.email || '-'}</td>
              <td>
                <button onClick={() => navigate(`/trainers/${t.id}`)}>
                  View Profile
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TrainerList;
